import React from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogTitle from '@material-ui/core/DialogTitle';

import Add from '@material-ui/icons/NoteAdd';

import { InputGroup } from 'react-bootstrap';
import { FormControl } from 'react-bootstrap';

export default function FormDialog() {
  const [open, setOpen] = React.useState(false);

  function handleClickOpen() {
    setOpen(true);
  }

  function handleClose() {
    setOpen(false);
  }

  return (
    <div>
      <Button justIcon onClick={handleClickOpen}>
        <Add />
      </Button>
      <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title">
        <DialogTitle id="form-dialog-title">Writting</DialogTitle>
        <DialogContent style={{width:"35rem", height:"50rem"}}>
          <TextField
            focused
            id="outlined-full-width"
            style={{ margin: 8, width: "31rem"}}
            placeholder="Enter here."
            margin="normal"
            variant="outlined"
            InputLabelProps={{
                shrink: true,
            }}
          />
          <div>
            <InputGroup>
              <InputGroup.Prepend>
                  <InputGroup.Text>textarea</InputGroup.Text>
              </InputGroup.Prepend>
              <FormControl as="textarea" aria-label="With textarea" />
            </InputGroup>
          </div>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="gray">
            Cancel
          </Button>
          <Button onClick={handleClose} color="gray">
            Save
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
